        total18:"",
        male119:"",
        female19:"",
        total19:"",
        male20:"",
        female20:"",
        total20:"",
        male21:"",
        female21:"",
        total21:"",
        male22:"",
        female22:"",
        total22:"",
        male23:"",
        female23:"",
        total23:"",
        loading:false,
        redirectToPage:false,
        error:false,
        reload:false,
        loadingBtn:false,
        districtList:[]
    })
    const {year, district, male1,female1,total1,male2, female2,total2, male3, female3,total3,male4, female4,total4,male5, female5,total5,male6, female6,total6,male7, female7,total7,male8, female8,total8,male9, female9,total9,male10, female10,total10,male11, female11,total11,male12, female12,total12,male13,female13,total13,male14, female14,total14,male15, female15,total15,male16, female16,total16,male17, female17,total17,male18, female18,total18,male19, female19,total19,male20, female20,total20,male21, female21,total21,male22, female22,total22,male23, female23,total23, loading, redirectToPage, loadingBtn,districtList  } = values
    const handleChange = name=>event=>{
        setValues({...values, [name]:event.target.value});
    }
    const submit = event =>{
        event.preventDefault();
        setValues({...values, loadingBtn:true})
        if(year===""){ 
            setValues({...values, loading:false})
            return Swal.fire('Oops...', 'year is required', 'error');
        }
        if(district===""){ 
            setValues({...values, loading:false})
            return Swal.fire('Oops...', 'district is required', 'error');
        }
        if(male1===""){ 
            setValues({...values, loading:false})
            return Swal.fire('Oops...', 'male age 3 population is required', 'error');
        }
        if(female1===""){ 
            setValues({...values, loading:false})
            return Swal.fire('Oops...', 'female age 3 population is required', 'error');
        }
        if(total1===""){ 
            setValues({...values, loading:false})
            return Swal.fire('Oops...', 'total age 3 population is required', 'error');
        }
        if(male2===""){ 
            setValues({...values, loading:false})
            return Swal.fire('Oops...', 'male age 4 population is required', 'error');
        }
        if(female2===""){ 
            setValues({...values, loading:false})
            return Swal.fire('Oops...', 'female age 4 population is required', 'error');
        }
        if(total2===""){ 
            setValues({...values, loading:false})
            return Swal.fire('Oops...', 'total age 4 population is required', 'error');
        }
        if(male3===""){ 
            setValues({...values, loading:false})
            return Swal.fire('Oops...', 'male age 5 population is required', 'error');
        }
        if(female3===""){ 
            setValues({...values, loading:false})
            return Swal.fire('Oops...', 'female age 5 population is required', 'error');
        }
        if(total3===""){ 
            setValues({...values, loading:false})
            return Swal.fire('Oops...', 'total age 5 population is required', 'error');
        }
        if(male4===""){ 
            setValues({...values, loading:false})
            return Swal.fire('Oops...', 'male age 6 population is required', 'error');
        }
        if(female4===""){ 
            setValues({...values, loading:false})
            return Swal.fire('Oops...', 'female age 6 population is required', 'error');
        }
        if(total4===""){ 
            setValues({...values, loading:false})
            return Swal.fire('Oops...', 'total age 6 population is required', 'error');
        }
        if(male5===""){ 
            setValues({...values, loading:false})
